import styled from 'styled-components';

const Tag = styled.span`
padding:0.5em;
position:relative;
float:left;
vertical-align:middle;
background-color: #cdcdcd;
border-radius: 10px;
margin-right:0.5em;
text-align:center;
`
const Index = (props) => {
    return <Tag>{props.children}</Tag>; 
};
export default Index;
